// src/components/UserManagement.js

import React, { useState, useEffect } from 'react';
import styles from '../styles/UserManagement.module.css';

function UserManagement() {
    const [users, setUsers] = useState([]);
    const [userId, setUserId] = useState('');
    const [userName, setUserName] = useState('');
    const [userRole, setUserRole] = useState('');

    useEffect(() => {
        // Simulação de busca de usuários
        fetch('/api/users')
            .then(response => response.json())
            .then(data => setUsers(data))
            .catch(error => console.error('Erro ao buscar usuários:', error));
    }, []);

    const handleSubmit = (e) => {
        e.preventDefault();
        if (userId) {
            // Lógica para editar o usuário
            fetch(`/api/users/${userId}`, {
                method: 'PUT',
                body: JSON.stringify({ name: userName, role: userRole }),
                headers: { 'Content-Type': 'application/json' }
            })
                .then(() => {
                    setUsers(users.map(user => user.id === userId ? { ...user, name: userName, role: userRole } : user));
                    resetForm();
                })
                .catch(error => console.error('Erro ao atualizar usuário:', error));
        } else {
            // Lógica para criar um novo usuário
            fetch('/api/users', {
                method: 'POST',
                body: JSON.stringify({ name: userName, role: userRole }),
                headers: { 'Content-Type': 'application/json' }
            })
                .then(response => response.json())
                .then(newUser => {
                    setUsers([...users, newUser]);
                    resetForm();
                })
                .catch(error => console.error('Erro ao criar usuário:', error));
        }
    };

    const handleEdit = (user) => {
        setUserId(user.id);
        setUserName(user.name);
        setUserRole(user.role);
    };

    const handleDelete = (userId) => {
        fetch(`/api/users/${userId}`, { method: 'DELETE' })
            .then(() => {
                setUsers(users.filter(user => user.id !== userId));
            })
            .catch(error => console.error('Erro ao deletar usuário:', error));
    };

    const resetForm = () => {
        setUserId('');
        setUserName('');
        setUserRole('');
    };

    return (
        <div className={styles.container}>
            <h1 className={styles.title}>Gestão de Usuários</h1>
            <form onSubmit={handleSubmit} className={styles.formGroup}>
                <label className={styles.label}>Nome do Usuário:</label>
                <input
                    type="text"
                    value={userName}
                    onChange={(e) => setUserName(e.target.value)}
                    className={styles.inputField}
                    required
                />
                <label className={styles.label}>Papel do Usuário:</label>
                <select
                    value={userRole}
                    onChange={(e) => setUserRole(e.target.value)}
                    className={styles.inputField}
                    required
                >
                    <option value="">Selecione um papel</option>
                    <option value="admin">Administrador</option>
                    <option value="manager">Gerente</option>
                    <option value="employee">Funcionário</option>
                </select>
                <button type="submit" className={styles.btnSubmit}>{userId ? 'Atualizar' : 'Criar'}</button>
                <button type="button" onClick={resetForm} className={styles.btnCancel}>Cancelar</button>
            </form>

            <h2 className={styles.subtitle}>Usuários Registrados:</h2>
            <ul className={styles.userList}>
                {users.map(user => (
                    <li key={user.id} className={styles.userItem}>
                        {user.name} - {user.role}
                        <button onClick={() => handleEdit(user)} className={styles.btnEdit}>Editar</button>
                        <button onClick={() => handleDelete(user.id)} className={styles.btnDelete}>Deletar</button>
                    </li>
                ))}
            </ul>
        </div>
    );
}

export default UserManagement;
